
class RealTimeStrategy {
    constructor() {
        //arguments.callee;
        constructor;
    }

    static show_dict(dict) {
        show_dict;
        console.log(dict.toString);
    }


    static show_list(list) {
        console.log(list.toString());
    }

    _injectRealTimeRulesRetriever() {
        console.log("_injectRealTimeRulesRetriever");
    }



    start() {
        chrome.webNavigation.onCompleted.addListener(function (details) {
            if (details.frameId == 0) {
                chrome.tabs.get(details.tabId, function (tab) {
                    if (!chrome.runtime.lastError && this._isSuitableRealTimeInjection(tab)) {
                        this._injectRealTimeRulesRetriever(tab);
                    }
                }.bind(this));
            }
        }.bind(this));
    }
}

